import "./notification.css"

const Notification = ({message, msgColor}) => {
    let notifColor
    if (msgColor)
        notifColor = msgColor;
    else
        notifColor = '#FFFFFF';
    return(
        <div style={{color: notifColor}} className="notification">{message}</div>
    )
}

export default Notification;
